('abt1', 'Nice Product Powered By Panacea-Soft', 'Panacea-Soft is a software development team that focuses on helping your business with mobile and web technology.We tried our best to delivery quality product on time according clients requirements and exceptions. We are technology oriented team so before we code, we analyse for your requirements and brain storm then start for development. We dont over promise to client and trying our best to deliver awesome product package. Thanks for reaching out to us. We are happy to listen your world and enjoy to solve the problem using technology.', 'teamps.is.cool@gmail.com', '+9592540942**', 'http://www.panacea-soft.com', 1, 'ca-pub-7127831079008160', '6882887537', 1, 'UA-79164209-2', 'http://www.facebook.com', 'http://www.google.com', 'http://www.instagram.com', 'http://www.youtube.com', 'http://www.pinterest.com', 'http://www.twitter.com', 'A privacy policy is a legal statement that discloses how a party gathers, stores, and uses the personal information it collects. Personal information refers to anything that can be used to identify an individual, including names, phone numbers, email addresses, device IDs, and locations.\r\n\r\n\r\nThese policies are used by companies and mobile app developers to stay compliant with federal laws. They fulfill the legal requirement to safeguard user privacy while also protecting the company itself from legal challenges.\r\n\r\n\r\nThe contents of these policies can vary greatly depending on the industry, user demographics, governing laws and jurisdictions, and application platform. Employing the use of third party services may also affect the need for one, as well as its contentseven if the app itself doesnt collect user information.', '', 50, '&lt;p&gt;Meet the seller in person and transfer cash only if you have secured the item. As a seller, ensure that you have secured your payment and safely exchanged your item. Do not transfer money in advance! Unless verified by your own bank directly, don&amp;#39;t trust any SMS or email about any money transferred to your account. Someone&amp;#39;s claim to have paid extra money by mistake and asking to return/reverse is suspicious in nature and should be avoided in all instances.&lt;/p&gt;', '&lt;p&gt;&lt;strong&gt;Lorem&lt;/strong&gt;, ipsum dolor sit amet consectetur adipisicing elit. Fugiat necessitatibus ad laboriosam veritatis eligendi illum natus autem accusantium sapiente a iusto eum iure quas numquam, cupiditate corrupti libero dolor commodi?&lt;/p&gt;', '&lt;p&gt;&lt;strong&gt;Lorem&lt;/strong&gt;, ipsum dolor sit amet consectetur adipisicing elit. Fugiat necessitatibus ad laboriosam veritatis eligendi illum natus autem accusantium sapiente a iusto eum iure quas numquam, cupiditate corrupti libero dolor commodi?&lt;/p&gt;');
