INSERT INTO `core_privacy_policy` (`id`, `content`) VALUES
('privacy1', '&lt;p&gt;&lt;strong&gt;Privacy Policy&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Panacea-Soft built the Flutter Ad House app as a Free app. This SERVICE is provided by Panacea-Soft at no cost and is intended for use as is.&lt;/p&gt;\r\n\r\n&lt;p&gt;This page is used to inform visitors regarding our policies with the collection, use, and disclosure of Personal Information if anyone decided to use our Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;If you choose to use our Service, then you agree to the collection and use of information in relation to this policy. The Personal Information that we collect is used for providing and improving the Service. we will not use or share your information with anyone except as described in this Privacy Policy.&lt;/p&gt;\r\n\r\n&lt;p&gt;The terms used in this Privacy Policy have the same meanings as in our Terms and Conditions, which is accessible at Flutter Ad House unless otherwise defined in this Privacy Policy.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Information Collection and Use&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;For a better experience, while using our Service, we may require you to provide us with certain personally identifiable information, including but not limited to Personal information refers to anything that can be used to identify an individual. including names, phone numbers, email, address, device IDs, and locations.. The information that we request will be retained by us and used as described in this privacy policy.&lt;/p&gt;\r\n\r\n&lt;p&gt;The app does use third party services that may collect information used to identify you.&lt;/p&gt;\r\n\r\n&lt;p&gt;Link to privacy policy of third party service providers used by the app&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;https://www.google.com/policies/privacy/&quot; target=&quot;_blank&quot;&gt;Google Play Services&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;https://support.google.com/admob/answer/6128543?hl=en&quot; target=&quot;_blank&quot;&gt;AdMob&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;https://www.facebook.com/about/privacy/update/printable&quot; target=&quot;_blank&quot;&gt;Facebook&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Log Data&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;we want to inform you that whenever you use our Service, in a case of an error in the app we collect data and information (through third party products) on your phone called Log Data. This Log Data may include information such as your device Internet Protocol (&amp;ldquo;IP&amp;rdquo;) address, device name, operating system version, the configuration of the app when utilizing our Service, the time and date of your use of the Service, and other statistics.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Cookies&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Cookies are files with a small amount of data that are commonly used as anonymous unique identifiers. These are sent to your browser from the websites that you visit and are stored on your device&amp;#39;s internal memory.&lt;/p&gt;\r\n\r\n&lt;p&gt;This Service does not use these &amp;ldquo;cookies&amp;rdquo; explicitly. However, the app may use third party code and libraries that use &amp;ldquo;cookies&amp;rdquo; to collect information and improve their services. You have the option to either accept or refuse these cookies and know when a cookie is being sent to your device. If you choose to refuse our cookies, you may not be able to use some portions of this Service.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Service Providers&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;we may employ third-party companies and individuals due to the following reasons:&lt;/p&gt;\r\n\r\n&lt;p&gt;To facilitate our Service;&lt;/p&gt;\r\n\r\n&lt;p&gt;To provide the Service on our behalf;&lt;/p&gt;\r\n\r\n&lt;p&gt;To perform Service-related services; or&lt;/p&gt;\r\n\r\n&lt;p&gt;To assist us in analyzing how our Service is used.&lt;/p&gt;\r\n\r\n&lt;p&gt;we want to inform users of this Service that these third parties have access to your Personal Information. The reason is to perform the tasks assigned to them on our behalf. However, they are obligated not to disclose or use the information for any other purpose.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Security&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;we value your trust in providing us your Personal Information, thus we are striving to use commercially acceptable means of protecting it. But remember that no method of transmission over the internet, or method of electronic storage is 100% secure and reliable, and we cannot guarantee its absolute security.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Links to Other Sites&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;This Service may contain links to other sites. If you click on a third-party link, you will be directed to that site. Note that these external sites are not operated by us. Therefore, we strongly advise you to review the Privacy Policy of these websites. we have no control over and assume no responsibility for the content, privacy policies, or practices of any third-party sites or services.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Children&amp;rsquo;s Privacy&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;These Services do not address anyone under the age of 13. we do not knowingly collect personally identifiable information from children under 13. In the case we discover that a child under 13 has provided us with personal information, we immediately delete this from our servers. If you are a parent or guardian and you are aware that your child has provided us with personal information, please contact us so that we will be able to do necessary actions.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Changes to This Privacy Policy&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;we may update our Privacy Policy from time to time. Thus, you are advised to review this page periodically for any changes. we will notify you of any changes by posting the new Privacy Policy on this page.&lt;/p&gt;\r\n\r\n&lt;p&gt;This policy is effective as of 2020-05-29&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Contact Us&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;If you have any questions or suggestions about our Privacy Policy, do not hesitate to contact us at teamps.is.cool@gmail.com.&lt;/p&gt;');
